// LeftSection.js
import React from 'react';
import './ContactLeftSection.css';

function ContactLeftSection() {
  return (
    <div className="left-section">
      <div className="content">
        <h1>The Power</h1>
        <p>Introducing Thumper</p>
        <p>A haptic communicator that creates precise taps. Sign up for a chance to try one.</p>
        <button className="learn-more">Learn More</button>
      </div>
    </div>
  );
}

export default ContactLeftSection;
